import React from 'react';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import { Link } from 'react-router-dom';
const HeaderPage = () =>{
    return ( 
         
        <div className="w-full h-[50px] bg-white fixed inset-x-0 top-0">
            <Link to="#" className="ml-4 mt-2 flex justify-center items-center w-10 h-10 hover:bg-gray-300 rounded-full">
                <DensityMediumIcon />
            </Link>
            
        </div>
    
    );
}
export default HeaderPage;
